// src/components/ProfileTabs/ActivityTab.js
import React from 'react';

const ActivityTab = ({ actions }) => {
  if (!actions) {
    return <p className="text-gray-400">Loading...</p>;
  }

  return (
    <div>
      <h2 className="text-2xl font-semibold mb-4">Your Activity & Stats</h2>
      <ul className="list-disc pl-5 space-y-2">
        <li>Customers Added: {actions.customersAdded}</li>
        <li>Jobs Added: {actions.jobsAdded}</li>
        <li>Jobs Completed: {actions.jobsCompleted}</li>
      </ul>
    </div>
  );
};

export default ActivityTab;
